import { Container } from "react-bootstrap-v5";
import * as Icon from "react-bootstrap-icons";

const Navigation = () => {
  <Container fluid className="green-bg">
    <Container>
      <Icon.Whatsapp color="green" size={20} />
    </Container>
  </Container>;
};
export default Navigation;
